import { StyleSheet, Text, View } from "react-native";
import React from "react";

const ProfileDetalis = () => {
  return (
    <View>
      <Text>ProfileDetalis</Text>
    </View>
  );
};

export default ProfileDetalis;

const styles = StyleSheet.create({});
